/** @jsxImportSource theme-ui */
import React from "react";
import { Grid, Label, Box, Input, Textarea, Button, Flex, Image, Text } from "theme-ui";

const ReviewBoxes = (props) => {
    return (
        <Flex sx={{ backgroundColor: 'navy50', px: '10px', py: '30px', borderRadius: '10px', mb: '20px', flexDirection: 'column' }}>
            <Box sx={{mb: '10px'}}>
                <Text
                    sx={{
                        color: 'navy0',
                        fontWeight: '700'
                    }}>
                    Project Name: {props.projectName}
                </Text>
            </Box>

            Body: {props.body}
            Rating: {props.rating}
            Author: {props.author}
        </Flex>
    )
}

export default ReviewBoxes;
